import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    const initialShot = path.join(screenshotsDir, 'step_1_initial.png');
    await page.screenshot({ path: initialShot });
    screenshots.push(initialShot);

    // Wait for at least one product price to appear using a unique selector
    // Try to locate a price using the .product-price class inside .product-card
    await page.waitForSelector('.product-card .product-price', { timeout: 5000 });

    // Take screenshot of product grid area if present
    const gridHandle = await page.$('.products-grid');
    if (gridHandle) {
      const gridShot = path.join(screenshotsDir, 'step_2_products_grid.png');
      await gridHandle.screenshot({ path: gridShot });
      screenshots.push(gridShot);
    }

    // Extract all product prices using multiple strategies
    // 1. All .product-price inside .product-card
    // 2. All .product-price anywhere
    // 3. Fallback: any $-prefixed text inside .product-card

    // Strategy 1: .product-card .product-price
    let prices = await page.$$eval('.product-card .product-price', nodes =>
      nodes.map(n => n.textContent.trim())
    );

    // If no prices found, try .product-price anywhere
    if (!prices || prices.length === 0) {
      prices = await page.$$eval('.product-price', nodes =>
        nodes.map(n => n.textContent.trim())
      );
    }

    // If still empty, try extracting $-prefixed text from .product-card
    if (!prices || prices.length === 0) {
      prices = await page.$$eval('.product-card', cards => {
        const priceRegex = /\$\d[\d,]*(?:\.\d{2})?/g;
        let found = [];
        cards.forEach(card => {
          const matches = (card.textContent.match(priceRegex) || []).map(s => s.trim());
          found.push(...matches);
        });
        return found;
      });
    }

    // Deduplicate and clean prices
    const uniquePrices = Array.from(new Set(prices.map(p => p.replace(/[\s\n]+/g, ' ').trim())));

    // Take screenshot highlighting the first price if possible
    if (uniquePrices.length > 0) {
      const firstPrice = uniquePrices[0];
      const priceHandle = await page.$(`text=${firstPrice}`);
      if (priceHandle) {
        const priceShot = path.join(screenshotsDir, 'step_3_first_price.png');
        await priceHandle.screenshot({ path: priceShot });
        screenshots.push(priceShot);
      }
    }

    return {
      success: true,
      action: "Extracted all product prices from the page using multiple selector strategies.",
      extractedData: {
        prices: uniquePrices
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
